import React from 'react';
import styles from './Pages.module.css';
import mainPhoto from '../images/photos/mainphoto.png';
import MyButton from '../UI/button/MyButton';

const MainPage = () => {
  return (
    <div className={styles.container}>
      <h2 className={styles['dancing-script']}>Main page</h2>
      <div className={styles.imageContainer}>
        <img
          src={mainPhoto}
          alt="Main photo by Victoria"
          className={styles.image}
        />
        <div className={styles.buttonOverlay}>
          <MyButton className={styles.overlayButton}>Главная</MyButton>
          <MyButton className={styles.overlayButton}>Биография</MyButton>
          <MyButton className={styles.overlayButton}>Портфолио</MyButton>
          <MyButton className={styles.overlayButton}>Резюме</MyButton>
          <MyButton className={styles.overlayButton}>Видео</MyButton>
          <MyButton className={styles.overlayButton}>Контакты</MyButton>
        </div>
        <div className={styles.textOverlay}>
          Виктория<br /> Волкова
        </div>
      </div>
    </div>
  );
};

export default MainPage;
